(function(){if($(".report-bar-chart").length){let a=new Array(40).fill(0).map((r,e)=>e%3==0||e%5==0?Math.ceil(Math.random()*-20+20):Math.ceil(Math.random()*-7+7)),t=a.map(r=>r>=8&&r<=14?$("html").hasClass("dark")?"#2E51BBA6":getColor("primary",.65):r>=15?$("html").hasClass("dark")?"#2E51BB":getColor("primary"):$("html").hasClass("dark")?"#2E51BB59":getColor("primary",.35)),l=$(".report-bar-chart")[0].getContext("2d"),s=new Chart(l,{type:"bar",data:{labels:a,datasets:[{label:"Html Template",barThickness:6,data:a,backgroundColor:t}]},options:{maintainAspectRatio:!1,plugins:{legend:{display:!1}},scales:{x:{ticks:{display:!1},grid:{display:!1}},y:{ticks:{display:!1},grid:{display:!1,drawBorder:!1}}}}});setInterval(()=>{let r=a[0];a.shift(),a.push(r);let e=t[0];t.shift(),t.push(e),s.update()},1e3)}})();
